import { Component, Prop, Vue } from "vue-property-decorator";

@Component
export default class Login extends Vue {
  username = "";
  password = "";
  submitted = false;

  get usernameValid() {
    return true;
  }
  get passwordValid() {
    return true;
  }
  onLogin(ev: any) {
    ev.preventDefault();
  }
}
